import React from 'react';

const Course = (props) => {
    return (
        <div>
            <div className="ui divider"></div>
            <h2>{props.name}</h2>
            <div className="ui divider"></div>
            <img alt="course" className="ui fluid image" src={props.image} />
            <br />
            <p>{props.description}</p>
            <br />
        </div>
    );
};

export default Course;
